snippet.textDisplay:
@Fábio Soldá concordo com você e para a pandemia acabar tem que ter vacina para todos. 
O nosso sistema imunológico será eficaz com a vacinação. O problema é que em outros países já estão na quarta dose e aqui  a terceira dose está abaixo de 60%!
Eu mesma vou ter que ir para o EUA tomar minha dose de reforço, pois se depender do governo federal (municipais e estaduais), não teremos a quarta dose 😫😫

